butionContract.sol":"devDockRewardDistribution"},"evmVersion":"london","libraries":{},"metadata":{"bytecodeHash":"ipfs","useLiteralContent":true},"optimizer":{"enabled":true,"runs":200},"remappings":[]},"sources":{"contracts/devDockRewardDistributionContract.sol":{"content":"//SPDX-License-Identifier: MIT
pragma solidity >=0.8.0 <0.9.0;
import "hardhat/console.sol";

interface IERC20 {
	function transferFrom(
		address sender,
		address recipient,
		uint256 amount
	) external returns (bool);
	function balanceOf(address userAddress) external view returns (uint);
}


contract devDockRewardDistribution{
	address public immutable owner;
	IERC20 public immutable token;
	mapping(address => uint) public claimableBalance;
	uint public availableForClaiming;

	constructor(address _owner,address _tokenAddress) {
		owner = _owner;
		token=IERC20(_tokenAddress);
		availableForClaiming = token.balanceOf(_owner);
	}

	modifier isOwner() {
		require(msg.sender == owner, "Not the Owner");
		_;
	}
	function getTokenBalanceOf(address userAddres) public view returns(uint){
		return token.balanceOf(userAddres);
	}
	function getPoolBalance()public view returns (uint){
		return availableForClaiming;
	}
	modifier validClaim() {
		require(claimableBalance[msg.sender]>0, "User Doesnot exist");
		require(availableForClaiming>=claimableBalance[msg.sender],"pool is empty try again later");
		_;
	}

	function updateBalance(address user, uint score) public isOwner {
		require(score>0 && score <11,"Invalid score");
		uint existingBalance = claimableBalance[user];
		uint reward = score *10*10**18;
		claimableBalance[user] = existingBalance + reward;
	}
	function getBalance(address user) public view returns(uint) {
		return claimableBalance[user];
	}
	function withdraw() public validClaim {
		token.transferFrom(owner, msg.sender, claimableBalance[msg.sender]);
		claimableBalance[msg.sender]=0;
		availableForClaiming=token.balanceOf(owner);
	}

	receive() external payable {}
}
